import './App.css';
import {Route, Routes, BrowserRouter} from 'react-router-dom'
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <BrowserRouter>
    <Header />
    <Routes>
      <Route exact path="/" element={ <Home/> } />
      </Routes>
    </BrowserRouter>

  );
}

export default App;
